window.bookSummaryJSON = "<p><b>From the master of the space opera comes a dark, mind-bending adventure spread across time and space, where Doctor Silas Coade is tasked with keeping his crew safe as they adventure across the galaxy in search of a mysterious artifact.</b></p> <p>In the 1800s, a sailing ship crashes off the coast of Norway. In the 1900s, a Zepellin explores an icy canyon in Antarctica. In the far future, a spaceship sets out for an alien artifact. Each excursion goes horribly wrong. And on every journey, Dr. Silas Coade is the physician, but only Silas seems to realize that these events keep repeating themselves. And it's up to him to figure out why and how. And how to stop it all from happening again.</p>"; 
